full_reasoning:
Step-by-Step Reasoning:
1. Key Psychological Mechanisms: In responder behavior the participant is sensitive to both the actual payoff (split_self) and how that payoff compares with a fairness reference point – namely, the “fair share” computed by the participant’s contribution relative to the total contributions (token_self divided by token_self + token_opp multiplied by the combined earning). Furthermore, people tend to be more sensitive to outcomes below this fairness reference (losses) than above it (gains), a concept derived from prospect theory.

2. How These Mechanisms Interact: The total utility for accepting an offer is constructed by taking the actual offer (split_self) and adding an adjustment term that depends on the fairness “deviation” (d). When the offer is at or above the fairness level (d ≥ 0), the additional utility is scaled by a fairness sensitivity parameter (gamma). When the offer is below the fairness level (d < 0), the penalty is amplified by an additional loss‐sensitivity parameter (lambda_param) applied to the deviation.

3. Mathematical Form: 
 • Define the fairness reference as: 
  fair_share = (token_self/(token_self + token_opp)) × combined_earning.
 • Compute deviation: d = split_self − fair_share.
 • The utility function becomes piecewise:
  If d ≥ 0 then: U_accept = split_self + gamma × d.
  If d < 0 then: U_accept = split_self + gamma × lambda_param × d.
This can be compactly expressed using indicator functions.

4. Parameters Needed:
 • gamma (γ): Reflects the sensitivity to fairness deviations when the offer is at or above the fairness reference.
 • lambda_param (λ): Represents the additional weight (loss aversion) applied when the offer falls below the fairness reference. Only two learnable parameters are used.

5. Mapping to Observables: The model uses observable variables (split_self, token_self, token_opp, combined_earning) to compute the fairness reference and the deviation. The final computed utility (U_accept) determines the attractiveness of accepting an offer, with negative values indicating an unlikely acceptance.

Based on this reasoning, here is the formal model specification:

<MODEL>
Let fair_share = (token_self / (token_self + token_opp)) × combined_earning 
and let d = split_self - fair_share.
Then, the utility for accepting an offer is:
  U_accept = split_self + gamma × [ I(d ≥ 0) × d + I(d < 0) × lambda_param × d ]
where I(condition) is an indicator function that equals 1 if the condition is true, and 0 otherwise.
</MODEL>

